import './swipertest.css';

import { Container, Row, Col } from "react-bootstrap";

import Image1 from '../SwiperTest/Image/image1.jpg';
import Image2 from '../SwiperTest/Image/image2.jpg';
import { useState } from 'react';

function SwiperTest(){

    const [age, setAge] = useState(19)

    const ClickClack = () => setAge(age + 1)

    return(
        <Container fluid>
            <p>Мне {age} лет</p>
            <button onClick={ClickClack}>
                Стать старше
            </button>
        </Container>   
    )
}
export default SwiperTest
